import React from 'react';
import styles from './App.module.css';
import RightBar from './components/RightBar/RightBar';
import { BrowserRouter } from 'react-router-dom';

const App = () => {
  return (
    <div className={styles.App}>
      <RightBar />
      <BrowserRouter>
      </BrowserRouter>
    </div>
  );
};

export default App;
